Rules:
The rules are simple:
- Pick a pawn to play as;
- Choose dice;
- The players roll the dice and the highest score gets the first move, but they have to roll again for the first move;
- Roll the dice;
- Move your pawn based on the score you got with the dice;
- If your last move ends at the beginning of a ladder, your pawn instantly moves to the top of the ladder;
- If your last move lands you at the head of a snake, you instantly move your pawn to it's tail;
- Get to "Finish" to finish;
- Special Note: In order to win, your last move needs to land you in the 100th spot. If you overshoot it, you simply skip your turn.
